actionConfiguration.body:
() => {
  let count = 0;
  for (let i = GET_DATA.data.length - 1; i >= 0; i--) {
    if (GET_DATA.data[i].REMARKS == "INTRESTED" || GET_DATA.data[i].REMARK == "RNR" || GET_DATA.data[i].REMARK == "SWITCH OFF/NOT REACHBLE" && GET_DATA.data[i].ACTIVE == "TRUE") {
      count = count + 1;
    }
  }
  return count;
}
